INSERT INTO `ps_cms_lang` VALUES
('1','1','1','Dostawa',NULL,'Opis dostawy','conditions, delivery, delay, shipment, pack','<p class=\"tw-data-text tw-text-large tw-ta\" id=\"tw-target-text\" style=\"text-align:left;\" dir=\"ltr\"><span class=\"Y2IQFc\" xml:lang=\"pl\" lang=\"pl\"><strong>Wysyki i zwroty</strong> </span></p>\n<p class=\"tw-data-text tw-text-large tw-ta\" style=\"text-align:left;\" dir=\"ltr\"><span class=\"Y2IQFc\" xml:lang=\"pl\" lang=\"pl\">Paczki s zazwyczaj wysyane w cigu 2 dni od otrzymania patnoci i s wysyane za porednictwem firmy UPS ze ledzeniem i nadawaniem bez podpisu. Jeli wolisz dostaw UPS Extra z wymaganym podpisem, zostanie naliczona dodatkowa opata, dlatego przed wybraniem tej metody skontaktuj si z nami. Bez wzgldu na to, jakiego rodzaju przesyki wybierzesz, otrzymasz od nas link do ledzenia przesyki online. Opaty za wysyk obejmuj opaty manipulacyjne i koszty pakowania, a take koszty wysyki. Opaty manipulacyjne s stae, natomiast opaty transportowe rni si w zalenoci od cakowitej wagi przesyki. Zalecamy zgrupowanie artykuw w jednym zamwieniu. Nie moemy zgrupowa dwch odrbnych zamwie zoonych oddzielnie, a opaty za wysyk bd naliczane dla kadego z nich. Paczka zostanie wysana na wasne ryzyko, ale naley zachowa szczegln ostrono w celu ochrony delikatnych przedmiotw. Pudeka s pokanych rozmiarw, a Twoje przedmioty s dobrze chronione.</span></p>','delivery'),
('2','1','1','Nota prawna',NULL,'Nota prawna','notice, legal, credits','<h2>Nota prawna</h2>\n<p>Ta strona powstala z wykorzystaniem oprogramowania otwarte-zrodlo <a href=\"http://www.prestashop.com\">PrestaSklep</a></p>','legal-notice'),
('3','1','1','Polityka prywatnoci',NULL,'Nasza polityka prywatnoci','conditions, terms, use, sell','<h2>Nasza polityka prywatno<span class=\"ILfuVd\" lang=\"pl\" xml:lang=\"pl\"><span class=\"hgKElc\"><b>ci</b></span></span></h2>\n<h3>Zasada 1</h3>\n<p>Nie m<span class=\"ILfuVd\" lang=\"pl\" xml:lang=\"pl\"><span class=\"hgKElc\">wimy o naszej polityce prywatno</span></span><span class=\"ILfuVd\" lang=\"pl\" xml:lang=\"pl\"><span class=\"hgKElc\">ci</span></span></p>','terms-and-conditions-of-use'),
('4','1','1','O nas',NULL,'Ucz si o nas','about us, informations','<h2>O nas</h2>\n<h3>Nasza firma</h3>\n<p>Dobry styl ma</p>\n<h3>Nasz zesp<span class=\"ILfuVd\" lang=\"pl\" xml:lang=\"pl\"><span class=\"hgKElc\"><b></b></span></span><span class=\"ILfuVd\" lang=\"pl\" xml:lang=\"pl\"><span class=\"hgKElc\"><b></b></span></span></h3>\n<p>Nie przeprowadza test<span class=\"ILfuVd\" lang=\"pl\" xml:lang=\"pl\"><span class=\"hgKElc\">w</span></span></p>\n<h3>Informacje</h3>\n<p>Im mniej wiesz tym lepiej <span class=\"ILfuVd\" lang=\"pl\" xml:lang=\"pl\"><span class=\"hgKElc\"></span></span>pisz</p>','about-us'),
('5','1','1','Bezpieczne patnoci',NULL,'Bezpieczestwo naszych patnoci','secure payment, ssl, visa, mastercard, paypal','<h2>Bezpieczne patnoci</h2>\n<h3>Bezpieczestwo naszych patnoci</h3>\n<p>U<span class=\"ILfuVd\" lang=\"pl\" xml:lang=\"pl\"><span class=\"hgKElc\"></span></span>ywamy SSL ale certyfikat jest samopodpisany wi<span class=\"ILfuVd\" lang=\"pl\" xml:lang=\"pl\"><span class=\"hgKElc\"></span></span>c troch<span class=\"ILfuVd\" lang=\"pl\" xml:lang=\"pl\"><span class=\"hgKElc\"></span></span> lipa</p>','secure-payment');
