('180','1','1','<p>Cheyenne Standard to proste spodnie w kolorze czarnym. Dopasowane, zaprasowane na kant. Wykonane z wysokiej jakoci weny. Cao wykoczona uszlachetniajcym praniem zmikczajcym. Nie odksztacaj si podczas noszenia i zapewniaj komfort uytkowania. Kieszenie angielskie. Z tyu dwie kieszenie dwuwypustkowe, zapinane na guzik. Idealne w formalnych stylizacjach. Spodnie tworz komplet z marynark.</p>','<p>100% Wena super 120\'s</p>','mix-match-spodnie-super-slim-do-garnituru',NULL,NULL,NULL,'MIX & MATCH - Spodnie super slim do garnituru','Dostpny','Niedostpny',NULL,NULL),
