('182','1','1','<p>Columbia Standard to proste spodnie w kolorze granatowym. Dopasowane, zaprasowane na kant. Wykonane w 100% z wysokogatunkowej weny, uszlachetnionej praniem zmikczajcym. Nie odksztacaj si podczas noszenia i zapewniaj komfort uytkowania. Kieszenie angielskie. Z tyu dwie kieszenie dwuwypustkowe, zapinane na guzik. Idealne do koszuli lub prostego swetra typu V-neck. Spodnie tworz komplet z marynark z tej samej tkaniny.</p>','<p>100% Wena super 120\'s</p>','mix-match-klasyczne-spodnie-do-garnituru',NULL,NULL,NULL,'MIX & MATCH - Klasyczne spodnie do garnituru','Dostpny','Niedostpny',NULL,NULL),
('183','1','1','<p>Columbia Standard to stylowa, jednorzdowa marynarka Vistula, grafitowa. Wykonana z wysokiej jakoci weny. Marynark cechuje dobre dopasowanie do sylwetki. Jest zapinana na dwa guziki z orzecha kamiennego. Z tyu jedno rozcicie. Marynark charakteryzuj, typowe dla marki Vistula, cechy: klasyczna elegancja, zgodno z aktualnymi trendami w modzie mskiej, wykorzystanie najlepszych tkanin. Cao wykoczona ozdobnym przeszyciem AMF, nawizujcym do tradycyjnego mskiego krawiectwa.</p>','<p>100% Wena super 120\'s, podszewka: 100% Wiskoza, podszewka rkaww: 56% Acetat, 44% Wiskoza</p>','marynarka-slim-fit-do-garnituru',NULL,NULL,NULL,'Marynarka slim fit do garnituru','Dostpny','Niedostpny',NULL,NULL),
('184','1','1','<p>Columbia Standard Solo to jednorzdowa marynarka w kolorze szarego melanu. Zostaa wykonana z tkaniny wenianej o parametrach super 120\'s od renomowanego producenta Marlane. Marynarka jest dobrze dopasowana do sylwetki. Zapinana jest na dwa guziki z mielonego rogu bawolego. Ma proste klapy, dwie dwuwypustkowe kieszenie z patkami oraz kieszonk na piersi z listewk. Z tyu znajduje si jedno rozcicie.\n\nWiskozowa podszewka w kolorze w groszki na szarym tle nadaje niepowtarzalnego charakteru.</p>','<p>100% Wena super 120\'s, podszewka: 100% Wiskoza, podszewka rkaww: 56% Acetat, 44% Wiskoza</p>','klasyczna-marynarka',NULL,NULL,NULL,'Klasyczna marynarka','Dostpny','Niedostpny',NULL,NULL),
