('190','1','1','<p>Columbia Standard to proste spodnie z szarej, melanowej tkaniny o diagonalnym splocie. Maj dopasowany fason, zaprasowane na kant nogawki oraz zaszewki z przodu i z tyu. Nie odksztacaj si podczas noszenia i zapewniaj komfort uytkowania. Kieszenie angielskie. Z tyu dwie kieszenie dwuwypustkowe, zapinane na guzik. Idealne w formalnych stylizacjach. Spodnie tworz komplet z marynark.</p>','<p>100% Wena, super 120\'s</p>','mix-match-spodnie-slim-fit-do-garnituru',NULL,NULL,NULL,'MIX & MATCH - Spodnie slim fit do garnituru','Dostpny','Niedostpny',NULL,NULL),
('191','1','1','<p>New Savoy T One to jednorzdowa marynarka z granatowej tkaniny o diagonalnym splocie. Zostaa uszyta z wysokiej jakoci weny o parametrach super 110\'s. Producentem tkaniny jest renomowana woska tkalnia Vitale Barberis Canonico. Marynarka ma wytaliowany fason i jest dobrze dopasowana do sylwetki. Ma szerokie klapy w szpic, dwie boczne kieszenie dwuwypustkowe z patkami, zaokrglone, wykoczone ozdobnym przeszyciem AMF nawizujcym do krawiectwa w tradycyjnym stylu. Na piersi kieszonka z listewk. Zapinana jest na dwa guziki z mielonego rogu bawolego. Z tyu posiada dwa rozcicia. Marynarka tworzy komplet ze spodniami. Model na zdjciu ma 186,5 cm wzrostu i prezentuje rozmiar 182/100.</p>','<p>100% Wena super 110\'s, podszewka: 100% Wiskoza, podszewka rkaww: 56% Acetat, 44% Wiskoza</p>','mix-match-marynarka-super-slim-do-garnituru',NULL,NULL,NULL,'MIX & MATCH - Marynarka super slim do garnituru','Dostpny','Niedostpny',NULL,NULL),
('192','1','1','<p>New Savoy T One to spodnie z granatowej tkaniny o diagonalnym splocie. Zostay wykonane z wysokiej jakoci weny o parametrach super 110\'s. Spodnie maj dopasowany krj, zaprasowany kant i angielskie kieszenie. Z przodu znajduje si dodatkowa kieszonka zwana zegarwk, z tyu dwie kieszenie dwuwypustkowe, zapinane na guzik. Spodnie tworz komplet z marynark. Model na zdjciu ma 186,5 cm wzrostu i prezentuje rozmiar 176/82.</p>','<p>100% Wena super 110\'s</p>','mix-match-spodnie-super-slim-do-garnituru',NULL,NULL,NULL,'MIX & MATCH - Spodnie super slim do garnituru','Dostpny','Niedostpny',NULL,NULL),
('193','1','1','<p>Mr. Plaza to jednorzdowa marynarka z tkaniny w kolorze granatowym. Wykonana z gadkiej tkaniny wenianej super 110\'s z wykoczeniem natural stretch. To specjalne wykoczenie, polegajce na wykurczeniu tkaniny w kocowej fazie produkcji. Dziki temu jest ona elastyczna bez dodawania wkien syntetycznych. Takie rozwizanie gwarantuje, e tkanina doskonale dopasowuje si do sylwetki i jest bardziej odporna na zagniecenia. Zapewnia to duy komfort noszenia i perfekcyjny wygld ubioru przez cay dzie. Marynarka Mr. Plaza ma dopasowany do sylwetki fason. Jest zapinana na dwa guziki. Klapy proste, dwie dwuwypustkowe kieszenie boczne z patkami oraz kiesze na piersi z listewk. Z tyu dwa rozcicia. Wytrzymaa, mia w dotyku podszewka w groszki dodaje caoci charakteru. Cao wykoczona ozdobnym przeszyciem AMF, nawizujcym do krawiectwa w tradycyjnym stylu. Marynarka tworzy komplet ze spodniami.</p>','<p>100% Wena super 110\'s, podszewka: 100% Wiskoza, podszewka rkaww: 56% Acetat, 44% Wiskoza</p>','mix-match-marynarka-slim-fit-do-garnituru',NULL,NULL,NULL,'MIX & MATCH - Marynarka slim fit do garnituru','Dostpny','Niedostpny',NULL,NULL),
